PRAGMA defer_foreign_keys=TRUE;
CREATE TABLE creators (   open_id TEXT PRIMARY KEY,   display_name TEXT,   avatar TEXT,   role TEXT,   connected_at INTEGER , deleted_at TEXT DEFAULT NULL);
CREATE TABLE users (   id INTEGER PRIMARY KEY,   email TEXT UNIQUE NOT NULL,   username TEXT UNIQUE,   full_name TEXT,   role TEXT NOT NULL CHECK (role IN ('brand','creator')),   phone TEXT,   terms_version TEXT,   accepted_terms_at INTEGER,   created_at INTEGER NOT NULL DEFAULT (unixepoch()),   updated_at INTEGER NOT NULL DEFAULT (unixepoch()),   pw_salt TEXT,   pw_hash TEXT );
CREATE TABLE addresses (   user_id INTEGER PRIMARY KEY,   country TEXT,   street TEXT,   city TEXT,   region TEXT,   postal TEXT,   updated_at INTEGER NOT NULL DEFAULT (unixepoch()),   FOREIGN KEY(user_id) REFERENCES users(id) );
CREATE TABLE admin_batches (
  id TEXT PRIMARY KEY,                 -- ULID
  actor_email TEXT NOT NULL,
  action TEXT NOT NULL,                -- e.g., import_brands, import_creators, users_delete, users_suspend
  meta_json TEXT,                      -- JSON blob with context
  created_at INTEGER NOT NULL          -- unix seconds
);
CREATE TABLE admin_audit (
  id TEXT PRIMARY KEY,                 -- ULID
  actor_email TEXT NOT NULL,
  action TEXT NOT NULL,                -- verb
  entity_table TEXT NOT NULL,
  entity_id TEXT,
  before_json TEXT,
  after_json  TEXT,
  batch_id TEXT,                       -- fk -> admin_batches.id (not enforced)
  created_at INTEGER NOT NULL
);
CREATE TABLE admin_recycle_bin (
  id TEXT PRIMARY KEY,                 -- ULID
  entity_table TEXT NOT NULL,
  entity_id TEXT NOT NULL,
  before_json TEXT NOT NULL,           -- full row JSON
  batch_id TEXT NOT NULL,
  created_at INTEGER NOT NULL
);
CREATE TABLE users_admin_meta (
  user_id TEXT PRIMARY KEY,            -- fk -> users.id (logical)
  last_login_at INTEGER,               -- unix seconds
  bestie_score REAL,                   -- 0..100
  suspended_at INTEGER                 -- null => active
);
CREATE TABLE directory_brands (
  id TEXT PRIMARY KEY,                 -- ULID
  public_code TEXT UNIQUE NOT NULL,    -- 10-digit with Luhn, starts with 5
  brand_name TEXT NOT NULL,
  brand_name_lower TEXT NOT NULL,
  website TEXT,
  website_normalized TEXT,             -- host/path normalized
  shortDesc TEXT,
  category_1 TEXT, category_2 TEXT, category_3 TEXT,
  public_contact TEXT,
  reviews_total INTEGER,
  rating_avg REAL,
  priceRange TEXT,
  estimated_monthly TEXT,              -- traffic or revenue (string to allow "Unknown")
  customer_age_range TEXT,
  customer_sex TEXT,
  social_platform_1 TEXT,
  social_platform_2 TEXT,
  top_creator_videos_1 TEXT,
  top_creator_videos_2 TEXT,
  last_seen TEXT,
  status TEXT NOT NULL DEFAULT 'seeded', -- seeded|verified|connected
  import_batch_id TEXT,
  created_at INTEGER NOT NULL,
  updated_at INTEGER NOT NULL
);
CREATE TABLE directory_creators (
  id TEXT PRIMARY KEY,                 -- ULID
  public_code TEXT UNIQUE NOT NULL,    -- 10-digit with Luhn, starts with 3
  platform TEXT,                       -- tiktok|instagram|mixed|unknown
  handle TEXT,
  handle_lower TEXT,
  tiktok_user_id TEXT,
  instagram_user_id TEXT,
  email TEXT,
  audience_country TEXT,
  followers_total INTEGER,
  avg_weekly_posts REAL,
  engagement_rate REAL,
  avg_views INTEGER,
  avg_likes INTEGER,
  avg_comments INTEGER,
  avg_shares INTEGER,
  audience_category_1 TEXT,
  audience_category_2 TEXT,
  audience_category_3 TEXT,
  audience_age_range TEXT,
  audience_sex TEXT,
  audience_location TEXT,
  last_active TEXT,
  -- per-platform metrics (optional)
  tiktok_followers INTEGER,
  tiktok_avg_views INTEGER,
  tiktok_avg_likes INTEGER,
  tiktok_avg_comments INTEGER,
  tiktok_avg_shares INTEGER,
  instagram_followers INTEGER,
  instagram_avg_views INTEGER,
  instagram_avg_likes INTEGER,
  instagram_avg_comments INTEGER,
  instagram_avg_shares INTEGER,
  status TEXT NOT NULL DEFAULT 'seeded', -- seeded|verified|connected
  import_batch_id TEXT,
  created_at INTEGER NOT NULL,
  updated_at INTEGER NOT NULL
);
CREATE TABLE brand_merge_map (
  directory_brand_id TEXT NOT NULL,
  account_user_id TEXT NOT NULL,
  merged_at INTEGER NOT NULL,
  admin_batch_id TEXT,
  PRIMARY KEY (directory_brand_id, account_user_id)
);
CREATE TABLE creator_merge_map (
  directory_creator_id TEXT NOT NULL,
  account_user_id TEXT NOT NULL,
  merged_at INTEGER NOT NULL,
  admin_batch_id TEXT,
  PRIMARY KEY (directory_creator_id, account_user_id)
);
CREATE TABLE invites (
  id TEXT PRIMARY KEY,                 -- ULID
  inviter_user_id TEXT NOT NULL,
  target_type TEXT NOT NULL,           -- brand_directory|creator_directory|user
  target_id TEXT NOT NULL,
  status TEXT NOT NULL,                -- draft|sent|accepted|declined|expired|revoked
  batch_id TEXT,
  created_at INTEGER NOT NULL
);
CREATE TABLE d1_migrations(
		id         INTEGER PRIMARY KEY AUTOINCREMENT,
		name       TEXT UNIQUE,
		applied_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP NOT NULL
);
CREATE TABLE brands (
  id INTEGER PRIMARY KEY AUTOINCREMENT,
  name TEXT NOT NULL,
  slug TEXT NOT NULL UNIQUE,
  domain TEXT UNIQUE,
  website_url TEXT NOT NULL,
  category_primary TEXT NOT NULL,
  category_secondary TEXT,
  category_tertiary TEXT,
  instagram_url TEXT,
  tiktok_url TEXT,
  shopify_shop_domain TEXT,
  description TEXT,
  contact_email TEXT,
  logo_url TEXT,
  status TEXT NOT NULL CHECK (status IN ('draft','published')) DEFAULT 'draft',
  featured INTEGER NOT NULL DEFAULT 0 CHECK (featured IN (0,1)),
  has_us_presence INTEGER NOT NULL DEFAULT 1 CHECK (has_us_presence IN (0,1)),
  is_dropshipper INTEGER NOT NULL DEFAULT 0 CHECK (is_dropshipper IN (0,1)),
  import_batch_id TEXT,
  created_at TEXT NOT NULL DEFAULT (strftime('%Y-%m-%dT%H:%M:%fZ','now')),
  updated_at TEXT NOT NULL DEFAULT (strftime('%Y-%m-%dT%H:%M:%fZ','now'))
, website_host_norm TEXT, shopify_domain_norm TEXT, deleted_at TEXT DEFAULT NULL, is_public INTEGER, customer_age_min INTEGER, customer_age_max INTEGER, price_low REAL, price_high REAL, affiliate_program INTEGER DEFAULT 0, cookie_days INTEGER DEFAULT 30, contact_form_url TEXT, brand_values TEXT, monthly_site_visits INTEGER, markets_primary TEXT DEFAULT 'US', country TEXT, state TEXT, city TEXT, zipcode TEXT, address TEXT, contact_name TEXT, contact_title TEXT, contact_phone TEXT, affiliate_cookie_days INTEGER DEFAULT 30, monthly_visits INTEGER DEFAULT 0, gifting_ok INTEGER DEFAULT 0);
CREATE TABLE config (
  key TEXT PRIMARY KEY,
  value TEXT NOT NULL,
  updated_at TEXT NOT NULL DEFAULT (strftime('%Y-%m-%dT%H:%M:%fZ','now'))
);
CREATE TABLE import_batches (id INTEGER PRIMARY KEY, created_at TEXT, source_uri TEXT, status TEXT);
CREATE TABLE import_rows (id INTEGER PRIMARY KEY, batch_id INTEGER NOT NULL, row_num INTEGER NOT NULL, parsed_json TEXT NOT NULL, errors_json TEXT, valid INTEGER);
CREATE TABLE brand_drafts (id INTEGER PRIMARY KEY, source_row_id INTEGER, data_json TEXT NOT NULL, issues_json TEXT, created_at TEXT);
DELETE FROM sqlite_sequence;
CREATE INDEX users_email_idx ON users(email);
CREATE INDEX users_username_idx ON users(username);
CREATE INDEX idx_admin_audit_created ON admin_audit(created_at DESC);
CREATE INDEX idx_admin_audit_batch ON admin_audit(batch_id);
CREATE INDEX idx_recycle_batch ON admin_recycle_bin(batch_id);
CREATE UNIQUE INDEX uq_dir_brands_site
  ON directory_brands(website_normalized)
  WHERE website_normalized IS NOT NULL;
CREATE UNIQUE INDEX uq_dir_brands_name_when_no_site
  ON directory_brands(brand_name_lower)
  WHERE website_normalized IS NULL;
CREATE INDEX idx_dir_brands_name ON directory_brands(brand_name_lower);
CREATE INDEX idx_dir_brands_last_seen ON directory_brands(last_seen);
CREATE UNIQUE INDEX uq_dir_creators_ttid
  ON directory_creators(tiktok_user_id) WHERE tiktok_user_id IS NOT NULL;
CREATE UNIQUE INDEX uq_dir_creators_igid
  ON directory_creators(instagram_user_id) WHERE instagram_user_id IS NOT NULL;
CREATE UNIQUE INDEX uq_dir_creators_platform_handle
  ON directory_creators(platform, handle_lower)
  WHERE platform IS NOT NULL AND handle_lower IS NOT NULL;
CREATE INDEX idx_dir_creators_last_active ON directory_creators(last_active);
CREATE INDEX idx_dir_creators_aud_country ON directory_creators(audience_country);
CREATE INDEX idx_invites_target ON invites(target_type, target_id);
CREATE UNIQUE INDEX uq_directory_brands_site ON directory_brands(website_normalized);
CREATE UNIQUE INDEX uq_directory_brands_name ON directory_brands(brand_name_lower);
CREATE UNIQUE INDEX uq_dir_creators_tiktok ON directory_creators(tiktok_user_id);
CREATE UNIQUE INDEX uq_dir_creators_instagram ON directory_creators(instagram_user_id);
CREATE UNIQUE INDEX uq_dir_creators_handle ON directory_creators(platform, handle_lower);
CREATE INDEX idx_brands_status ON brands(status);
CREATE INDEX idx_brands_featured ON brands(featured);
CREATE INDEX idx_brands_categories ON brands(category_primary, category_secondary, category_tertiary);
CREATE UNIQUE INDEX ux_brands_website_url
  ON brands(website_url COLLATE NOCASE)
  WHERE website_url IS NOT NULL AND website_url <> '';
CREATE UNIQUE INDEX ux_brands_shopify_domain
  ON brands(shopify_shop_domain COLLATE NOCASE)
  WHERE shopify_shop_domain IS NOT NULL AND shopify_shop_domain <> '';
CREATE INDEX ix_brands_status ON brands(status);
CREATE INDEX ix_brands_name ON brands(name COLLATE NOCASE);
CREATE UNIQUE INDEX ux_brands_website_host_norm
  ON brands(website_host_norm)
  WHERE website_host_norm IS NOT NULL AND website_host_norm <> '';
CREATE UNIQUE INDEX ux_brands_shopify_domain_norm
  ON brands(shopify_domain_norm)
  WHERE shopify_domain_norm IS NOT NULL AND shopify_domain_norm <> '';
CREATE INDEX idx_brands_deleted_at   ON brands(deleted_at);
CREATE INDEX idx_creators_deleted_at ON creators(deleted_at);
CREATE INDEX idx_brands_slug ON brands(slug);
CREATE UNIQUE INDEX idx_brands_slug_unique ON brands(slug);
CREATE INDEX idx_import_rows_batch ON import_rows(batch_id);
CREATE TRIGGER trg_brands_updated_at
AFTER UPDATE ON brands
FOR EACH ROW BEGIN
  UPDATE brands SET updated_at = CURRENT_TIMESTAMP WHERE id = OLD.id;
END;
